  <ul>
    {items.map((item) => (
      <li key={item.id}>
        {/* <Link
          to={{
            pathname: `${match.path}/${item.id}`,
            state: { from: location },
          }}
        >
        </Link> */}
        {item.title}
      </li>
    ))}
  </ul>
);

export default withRouter(ArticleList);
